import React, { Component } from 'react';
import Paper from '@material-ui/core/Paper';
import Button from '@material-ui/core/Button';
import {connect} from 'react-redux'
import {fetchIssue} from './../../../actions/repo.actions'
import {getIssueBlob} from './../../../reducers/repo.reducer';
import RichTextInput from './../../global/components/richTextInput';
import Comment from './components/comment';

class IssuePage extends Component {
  constructor(props){
    super(props);
    this.props.dispatch(fetchIssue(this.props.match.params.id,this.props.match.params.repo))
    this.goback=this.goback.bind(this);
    this.handleUser=this.handleUser.bind(this);
  }
  goback(){
    let user= this.props.match.params.user
    let repo= this.props.match.params.repo
    console.log(user,repo);
    this.props.history.push(`/source/${user}/${repo}`);
  }
  handleUser(user){
    this.props.history.push(`/source/${user}`);
  }
  render() {
    if(this.props.issue!==undefined&&this.props.issue!==false)
    return (
      <div className="IssuePage">
        <Paper className="IssuePagePaper" elevation={0}>
          <div className="IssueTitle">
            <h2 onClick={this.goback} style={{cursor:"pointer", color:"blue"}}>{this.props.match.params.repo}</h2>
            <h2 className="separator">/</h2>
            <h2>{this.props.issue.title}</h2>
          </div>
          <div className="IssueInfo">
            <div className="IssueHeader">
              <div className="IssueAuthor">
                  <p>Opened by: </p>
                  <p onClick={()=>this.handleUser(this.props.issue.creator)} style={{cursor:"pointer"}}>{this.props.issue.creator}</p>
              </div>
              <div className="IssueActions">
                <Button color="primary" style={{fontFamily:"gotham_htfbook"}}>Resolve</Button>
                <Button color="primary" style={{fontFamily:"gotham_htfbook"}}>Close</Button>
              </div>
            </div>
            <div className="Comments" style={{marginBottom:"25px"}}>
              <Comment/>
              <Comment/>
            </div>
            <RichTextInput/>
          </div>
        </Paper>
      </div>
    );
    else return(<div>Loading</div>)
  }
}

const mapStateToProps=(state)=>{
  return {
    issue: getIssueBlob(state)
  }
}
export default connect(mapStateToProps)(IssuePage);
